Гарбуз та картопля з індичкою – це органічне ретельно гомогенізоване м‘ясо-овочеве пюре, є джерелом цінного білку, вітамінів, мінеральних речовин та заліза, що легко засвоюється. Пюре готують з використанням гарячої пари, що разом із вакуумною упаковкою баночки зберігає природні вітаміни протягом тривалого часу;
низькоалергенний; з Омега-3 жирними кислотами органічної ріпакової олії, які важливі для розвитку мозку та нервових клітин; не містить глютену; без згущувачів – при розшаровуванні перемішайте; без додавання солі; без ароматизаторів; без барвників; без консервантів; регулює випорожнення; не містить генетично
модифікованих компонентів (без ГМО).

Ефірна олія м’яти перцевої допомагає при нервовому збудженні, усуває відчуття люті і роздратування. Олію м’яти використовують для полегшення астенічних розладів (в тому числі запаморочень, нудоти, заколисування), зубного болю, нападів печії, шлункових спазмів, наслідків переїдання, болю в серці. Олію м’яти також застосовують в косметології, це аромаолія допоможе впоратися з судинним і капілярним малюнком на поверхні шкіри і з висипом вугрів.
-Ефірна олія м’яти перцевої допомагає при нервовому збудженні, усуває відчуття люті і роздратування;
-Відновлює сили, усуває відчуття нервозність, викликану перевтомою і дефіцитом сну;
-При простудних захворюваннях має противірусну, антибактеріальну та жарознижувальну дію;
-Знижує підвищену чутливість до зміни погоди;
-Усуває головний біль і запаморочення, викликану гіпоксією і перевтомою;
-Полегшує серцеві болі при неврозах, зменшує прискорене серцебиття;
-Рекомендується при закачуванні в транспорті;
-Знімає м’язові і невралгічні болі;
