-Використовується для масажу.

Ефірна олія ялівцю відновлює душевну рівновагу при стресах і тривозі, загострює пам’ять, тонізує, підвищує життєву активність. Ялівцева ефірна олія володіє цілим комплексом терапевтичних властивостей: антисептичною, тонізуючою, очищаючою, снодійною, протиревматичною, потогінною, нормалізуючою, інсектицидною, ранозагоювальною, сечогінною. Ялівцеву олію вважаються одною з найсильніших засобів, що очищає, ефективно виводить токсини і налагоджує роботу шлунково-кишкового тракту. При простудних захворюваннях має протизапальну, відхаркувальну та пом’якшуючу дію на дихальні шляхи. У догляді за волоссям олія ялівцю має загальнозміцнювальну дію, відновлює природний блиск і перешкоджає утворенню лупи.
