-Загострює пам’ять, тонізує, підвищує життєву активність;
-Ефективний зміцнювальний засіб;
-Потужний антисептик при простудних і вірусних захворюваннях;
-Надає відхаркувальну дію при гострих і хронічних захворюваннях органів дихання;
-Усуває запаморочення і слабкість, викликану зниженням артеріального тиску;
