-Ефірна олія кориці усуває депресивний стан, веселить, зігріває;
-Створює творчий настрій;
-Допомагає при запамороченні, нудоті;
-Сприяє усуненню бородавок, папілом;
-Перешкоджає утворенню целюліту;
-Підсилює обмін речовин;
-Афродизіак.

