-Має антиоксидантну, регенеруючу дію;
-Відновлює еластичність шкіри, живить, розгладжує, оживляє її;
-Усуває роздратування, лущення, запалення шкіри;
-Пом’якшує суху шкіру на ліктях, долонях, стопах;
